import React from "react"
import { Box, HStack, VStack} from "@chakra-ui/react";

const doormatNav =[
    {
        name: "Home",
        link: "/home",
    },
    {
        name: "About",
        link: "/about",
    },
    {
        name: "Menu",
        link: "/menu",
    },
    {
        name: "Reservation",
        link: "/reservation",
    },
    {
        name: "Order Online",
        link: "/order",
    },
    {
        name: "Login",
        link: "/login",
    }
];

const contact = [
    {
        name: "Address",
        link: "/address"
    },
    {
        name: "phone number",
        link: "/number",
    },
    {
        name: "email",
        link: "/email"
    }
];


const  Footer = () =>{
    return (<footer>
        <HStack>
            <VStack>
            <p>Door Navigation</p>
            {doormatNav.map((door)=>(
                <a href = {door.link}> {door.name}</a>
            ))}
            </VStack>
            <VStack>
                <p>contact</p>
                {contact.map((con)=>(
                    <a href = {con.link}> {con.name} </a>
                ))}
            </VStack>
            <VStack>
                <p>Social media</p>
                {contact.map((con)=>(
                    <a href = {con.link}> {con.name} </a>
                ))}
            </VStack>
        </HStack>

    </footer>);
};

export default Footer;
